import React from 'react';
import { Link } from 'react-router-dom';


class Header extends React.Component {
    constructor(props){
        super(props);
    }

    render() {
        return (
            <div>
                <li><Link to="/email">Campaign</Link></li>
                <li><Link to="/">Addres Finder</Link></li>
            </div>
        )
    }


}

export default Header;
